A serial killer returns to his hometown to stalk seven children who share the same birthday as the date he was allegedly put to rest.

Storyline

In the sleepy town of Riverton, legend tells of a serial killer who swore he would return to murder the seven children born the night he died. Now, 16 years later, people are disappearing again. Has the psychopath been reincarnated as one of the seven teens, or did he survive the night he was left for dead? Only one of the kids knows the answer. Adam &quot;Bug&quot; Heller (Max Thieriot) was supposed to die on the last night the Riverton Ripper wrecked havoc on that terrifying night. Unaware of terrifying crimes being committed to the seven children, he has been plagued by nightmares of their murders while not aware if they hold true or if he is simply imagining the images that haunt him. But if Bug hopes to save his friends from the monster that's returned, he must face an evil that won't rest...until it finishes the job it began the day he was born.

